import About from "./About";
import Featured from "./Featured";
import Gallery from "./Gallery";
import Hero from "./Hero";

const Home = () => {
  return (
    <div>
      <Hero />
      <Featured />
      <About />
      <Gallery />
    </div>
  );
};

export default Home;
